import React from "react";
import Modal from "../UI/Modal";
import classes from './BillDetail.module.css'

const BillDetail=(props) =>{

  return (
    <Modal>
      <div>
        <p>bill product</p>
        <button className={classes.close}>close</button>
      </div>
    </Modal>
  );
}

export default BillDetail;
